ata":{}}],"execution_count":226},{"cell_type":"code","source":"# Load required library\nlibrary(vars)\n\n# Define lag order\np <- 2  # Example: 2 lags\n\n# Create lagged dataset but exclude lags of avg_water_surge\nyarmouth_data_lags <- embed(as.matrix(yarmouth_var), p + 1)  # Embed function creates lagged matrix\n\n# Convert to a dataframe\nyarmouth_lagged_df <- as.data.frame(yarmouth_data_lags)\n\n# Rename columns for clarity\ncolnames(yarmouth_lagged_df) <- c(\"avg_water_surge\", \"avg_temperature\", \"avg_wind_speed\", \"rain\",\n                                 \"avg_water_surge.l1\", \"avg_temperature.l1\", \"avg_wind_speed.l1\", \"rain.l1\",\n                                 \"avg_water_surge.l2\", \"avg_temperature.l2\", \"avg_wind_speed.l2\", \"rain.l2\")\n\n# Fit linear model without avg_water_surge lags\nyarmouth_var_custom <- lm(avg_water_surge ~ avg_temperature.l1 + avg_wind_speed.l1 + rain.l1 + \n                                            avg_temperature.l2 + avg_wind_speed.l2 + rain.l2, \n                         data = yarmouth_lagged_df)\n\nsummary(yarmouth_var_custom)  # Check results","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-15T20:04:56.473728Z","iopub.execute_input":"2025-03-15T20:04:56.475393Z","iopub.status.idle":"2025-03-15T20:04:56.582766Z","shell.execute_reply":"2025-03-15T20:04:56.578590Z"}},"outputs":[{"output_type":"display_data","data":{"text/plain":"\nCall:\nlm(formula = avg_water_surge ~ avg_temperature.l1 + avg_wind_speed.l1 + \n    rain.l1 + avg_temperature.l2 + avg_wind_speed.l2 + rain.l2, \n    data = yarmouth_lagged_df)\n\nResiduals:\n     Min       1Q   Median       3Q      Max \n-0.55294 -0.08714 -0.00390  0.08055  0.67597 \n\nCoefficients:\n                     Estimate Std. Error t value Pr(>|t|)    \n(Intercept)         1.895e-02  3.619e-03   5.237 1.65e-07 ***\navg_temperature.l1  3.070e-03  3.227e-04   9.513  < 2e-16 ***\navg_wind_speed.l1  -1.639e-03  1.430e-04 -11.462  < 2e-16 ***\nrain.l1    